import React from "react";
import {
  CircularProgress,
  Grid,
  Typography,
  makeStyles,
  Divider,
  Button,
  Avatar,
} from "@material-ui/core";
// hook
import { useFetch } from "../../../hooks";
// components
import ListrningAidCard from "./ListrningAidCard";

const useStyles = makeStyles({
  title: {
    fontWeight: "bold",
  },
});

const ClientListeningAid = () => {
  const { data, isLoading } = useFetch("/listeningaids/group");
  const clasess = useStyles();

  const listeningAidList = data.map((information) => (
    <Grid key={information._id} item xs={12} sm={6} md={6} lg={4}>
      <ListrningAidCard information={information} />
    </Grid>
  ));

  return (
    <div>
      <Grid container spacing={3}>
        <Grid item xs={12}>
          <Typography variant="h3" align="center" className={clasess.title}>
            Listening Aid
          </Typography>
        </Grid>
        <Divider></Divider>
        <div>
          <div class="style-link" style="width: 100%; display: inline-block;">
            <a href="/hearing-aids/styles/receiver-in-canal" tabindex="0">
              <img
                src="/-/media/ConsumerSites/Images/Renderings/ItemSource/StylesBox/Starkey/product-ric.png?h=400&amp;w=240&amp;la=en&amp;hash=8615B5D91E31512C011B26B3D2C5E7114B91B07B"
                alt="product-ric-hearing-aids"
              />
              <h5>Receiver-In-Canal (RIC)</h5>
            </a>
          </div>
        </div>
        {isLoading ? (
          <CircularProgress />
        ) : (
          <Grid item xs={12}>
            {listeningAidList}
          </Grid>
        )}
      </Grid>
    </div>
  );
};

export default ClientListeningAid;
